import React from 'react';
import Header from './Header';
import Footer from './Footer';
import Bio from './Bio';

const App=()=>{
    return(
        <React.Fragment>
            <Header />
            <Bio />
            <Footer />

        </React.Fragment>
    );
}

export default App;
